desktopweb.customCSS:
/* Please make sure to not 
to assign this skin to anything
*/
input:-webkit-autofill,
input:-webkit-autofill:hover, 
input:-webkit-autofill:focus, 
input:-webkit-autofill:active, input::-webkit-outer-spin-button,
input::-webkit-inner-spin-button {
/* display: none; <- Crashes Chrome on hover */
-webkit-appearance: none;
margin: 0; /* <-- Apparently some margin are still there even though it's hidden */
}
input[type=number]{
-moz-appearance:textfield; /* Firefox */
} 
input:-internal-autofill-selected{
  transition: background-color 5000s ease-in-out 0s;
}
div[kwidgettype="Label"]
{
   outline:none !important;
   cursor:default !important;
}
div[kwidgettype="Label"]:focus
{
   outline:none !important;
  cursor:default !important;
}
input[kwidgettype="TextField"]:focus
{
	 outline:none !important;
} 
input[kwidgettype="Button"]:focus
{
	 outline:none !important;
} 
input[kwidgettype="Button"]:hover
{
	 cursor:pointer !important;
}
input[kwidgettype="Label"]:focus
{
	outline:none !important;
}
.shellDBX {
  position: relative;
  line-height: 1;
}
.shellDBX span {
  position: absolute;
  left: 3px;
  top: 1px;
  color: #ccc;
  pointer-events: none;
  z-index: -1;
}
.shellDBX span i {
  font-style: normal;
  color: transparent;
  opacity: 0;
  visibility: hidden;
}
input.maskedDBX,
.shellDBX span {
  font-size: 18px;
  font-family: SourceSansPro-Regular;
  letter-spacing : 4px;
  padding-right: 10px;
  background-color: transparent;
  outline:none;
  text-transform: uppercase;
}

input::-ms-clear, input::-ms-reveal {
   display: none;
}

input::-webkit-credentials-auto-fill-button {
  visibility: hidden;
  pointer-events: none;
  position: absolute;
  right: 0;
}
